A90145C74C44ECB48AC772B05487CA','483911AC1EE24239932750AACA69771B','C993D1D33D494B44BA8842110876D417','B342FD5CA1C64E8BA25A0A6F6C98C7DA','1052C4B77714415C8CF89DEB7B4349A3','A861C268485947AF8C55595A08CA62EE','6557A8E827ED40BDAE66E4A78166A839','8CF74AC370B04133B54C44A12E084749','8CF74AC370B04133B54C44A12E084749','F7C859920B904536A9CCF3A84729AA52','2317023F9771481696461C5EAF9A0915','5D5792C53FBA46E2988653B6DC9FE5B4','ABE2033C7A74499A9750346A83DE3307','2E1E735AA91A49F8BC7181D31B09B370','CA91E28A17EA4CD88C3E29569174C921') AND (select count(*) from c_poc_doctype_template cpdt where cpdt.c_doctype_id = cd.c_doctype_id AND cpdt.name = 'OpenZ Standardreport' AND cpdt.templatelocation = '@basedesign@/org/openbravo/erpCommon/utility/reporting/printing/reports/' AND reportfilename = 'DocNo-@our_ref@' AND templatefilename = 'Openz_Standardreport.jrxml') = 0)\r\n\r\nloop\r\n\r\n\tv_poc_doctype_template_id := get_uuid();\r\n\r\n\tv_isdefault := (SELECT CASE WHEN (SELECT count(*) from c_poc_doctype_template where c_poc_doctype_template.c_doctype_id = v_doctype.c_doctype_id AND isdefault = 'Y') = 0 THEN 'Y' ELSE 'N' END);\r\n\r\n\tInsert into c_poc_doctype_template\r\n\t(\r\n\t\tc_poc_doctype_template_id,\r\n\t\tad_client_id,\r\n\t\tad_org_id,\r\n\t\tisactive,\r\n\t\tcreated,\r\n\t\tcreatedby,\r\n\t\tupdated,\r\n\t\tupdatedby,\r\n\t\tc_doctype_id,\r\n\t\tname,\r\n\t\ttemplatelocation,\r\n\t\treportfilename,\r\n\t\ttemplatefilename,\r\n\t\tisdefault,\r\n\t\tc_printout_config_id\r\n\t)\r\n\tVALUES\r\n\t(\r\n\t\tv_poc_doctype_template_id,\t\t\r\n\t\t'0',\r\n\t\t'0',\r\n\t\t'Y',\r\n\t\tnow(),\r\n\t\t'0',\r\n\t\tnow(),\r\n\t\t'0',\r\n\t\tv_doctype.c_doctype_id,\r\n\t\t'OpenZ Standardreport',\r\n\t\t'@basedesign@/org/openbravo/erpCommon/utility/reporting/printing/reports/',\r\n\t\t'DocNo-@our_ref@',\r\n\t\t'Openz_Standardreport.jrxml',\r\n\t\tv_isdefault,\r\n\t\tnull\r\n\t); \r\n\r\n\tv_doctype_counter := 1 + v_doctype_counter; \r\n\r\n\r\n\t-- alle c_poc_doctype_template_ids die zu diesem doctype passen und Rpt-Standard sind\r\n\tv_doctype_template_ids := (select ARRAY[c_poc_doctype_template_id] from c_poc_doctype_template cpdt where cpdt.c_doctype_id = v_doctype.c_doctype_id AND cpdt.name = 'Standard Template' AND cpdt.templatelocation = '@basedesign@/org/openbravo/zsoft/smartui/printing' AND reportfilename = 'DocNo-@our_ref@' AND templatefilename = 'Rpt_Standard.jrxml');\r\n\r\n\r\n\t-- Übersetzung anlegen\r\n\tfor v_poc_doctype_template_trl in (select * from c_poc_doctype_template_trl where c_poc_doctype_template_id = ANY(v_doctype_template_ids))\r\n\t\r\n\tloop\r\n\r\n\t\tInsert into c_poc_doctype_template_trl\r\n\t\t(\r\n\t\t\tc_poc_doctype_template_trl_id,\r\n\t\t\tad_language,\r\n\t\t\tad_client_id,\r\n\t\t\tad_org_id,\r\n\t\t\tisactive,\r\n\t\t\tcreated,\r\n\t\t\tcreatedby,\r\n\t\t\tupdated,\r\n\t\t\tupdatedby,\r\n\t\t\tc_poc_doctype_template_id,\r\n\t\t\tc_doctype_id,\r\n\t\t\treporttitle,\r\n\t\t\tdocumentnote\r\n\t\t)\r\n\t\tVALUES\r\n\t\t(\r\n\t\t\tget_uuid(),\r\n\t\t\tv_poc_doctype_template_trl.ad_language,\r\n\t\t\tv_poc_doctype_template_trl.ad_client_id,\r\n\t\t\tv_poc_doctype_template_trl.ad_org_id,\r\n\t\t\tv_poc_doctype_template_trl.isactive,\r\n\t\t\tnow(),\r\n\t\t\tv_poc_doctype_template_trl.createdby,\r\n\t\t\tnow(),\r\n\t\t\tv_poc_doctype_template_trl.updatedby,\r\n\t\t\tv_poc_doctype_template_id,\r\n\t\t\tv_doctype.c_doctype_id,\t\r\n\t\t\tv_poc_doctype_template_trl.reporttitle,\r\n\t\t\tv_poc_doctype_template_trl.documentnote\r\n\t\t);\r\n\r\n\t\tv_translation_counter := 1 + v_translation_counter;\r\n\t\t\r\n\tend loop;\r\n\r\n\r\n\t-- Email-Einstellung anlegen\r\n\tfor v_poc_emaildefinition in (select * from c_poc_emaildefinition where c_poc_doctype_template_id = ANY(v_doctype_template_ids)) \r\n\r\n\tloop\r\n\r\n\t\tInsert into c_poc_emaildefinition\r\n\t\t(\r\n\t\t\tc_poc_emaildefinition_id,\r\n\t\t\tad_client_id,\r\n\t\t\tad_org_id,\r\n\t\t\tisactive,\r\n\t\t\tcreated,\r\n\t\t\tcreatedby,\r\n\t\t\tupdated,\r\n\t\t\tupdatedby,\r\n\t\t\tc_poc_doctype_template_id,\r\n\t\t\tsubject,\r\n\t\t\tbody,\r\n\t\t\tisdefault,\r\n\t\t\tad_language\r\n\t\t)\r\n\t\tVALUES\r\n\t\t(\r\n\t\t\tget_uuid(),\r\n\t\t\tv_poc_emaildefinition.ad_client_id,\r\n\t\t\tv_poc_emaildefinition.ad_org_id,\r\n\t\t\tv_poc_emaildefinition.isactive,\r\n\t\t\tnow(),\r\n\t\t\tv_poc_emaildefinition.createdby,\r\n\t\t\tnow(),\r\n\t\t\tv_poc_emaildefinition.updatedby,\r\n\t\t\tv_poc_doctype_template_id,\r\n\t\t\tv_poc_emaildefinition.subject,\r\n\t\t\tv_poc_emaildefinition.body,\r\n\t\t\tv_poc_emaildefinition.isdefault,\r\n\t\t\tv_poc_emaildefinition.ad_language\r\n\t\t);\r\n\r\n\t\tv_emaildefinition_counter := 1 + v_emaildefinition_counter;\r\n\r\n\tend loop;\r\n\r\n\r\n\t-- falls keine Email-Einstellungen angelegt wurden, lege eine leere an\r\n\tif (0 = v_emaildefinition_counter) then\r\n\r\n\t\tInsert into c_poc_emaildefinition\r\n\t\t(\r\n\t\t\tc_poc_emaildefinition_id,\r\n\t\t\tad_client_id,\r\n\t\t\tad_org_id,\r\n\t\t\tisactive,\r\n\t\t\tcreated,\r\n\t\t\tcreatedby,\r\n\t\t\tupdated,\r\n\t\t\tupdatedby,\r\n\t\t\tc_poc_doctype_template_id,\r\n\t\t\tsubject,\r\n\t\t\tbody,\r\n\t\t\tisdefault,\r\n\t\t\tad_language\r\n\t\t)\r\n\t\tVALUES\r\n\t\t(\r\n\t\t\tget_uuid(),\r\n\t\t\t'0',\r\n\t\t\t'0',\r\n\t\t\t'Y',\t\r\n\t\t\tnow(),\r\n\t\t\t'0',\r\n\t\t\tnow(),\r\n\t\t\t'0',\r\n\t\t\tv_poc_doctype_template_id,\r\n\t\t\t'',\r\n\t\t\t'',\r\n\t\t\t'',\r\n\t\t\t'de_DE'\r\n\t\t);\r\n\t\t\r\n\t\tv_emaildefinition_counter := 1 + v_emaildefinition_counter;\r\n\r\n\tend if;\r\nend loop;\r\n\r\n\treturn 'c_poc_doctype_templates created: ' || v_doctype_counter || '\t' ||\r\n\t\t'c_poc_doctype_template_trl created: ' || v_translation_counter || '\t' ||\r\n\t\t'c_poc_emaildefinition created: ' || v_emaildefinition_counter;\r\nEND;\r\n$_$\r\n  LANGUAGE plpgsql VOLATILE\r\n  COST 100;\r\n	30	3.2.21.900
