B5123C0141EF41558434F5121A4965D3	0	0	0	Y	2012-10-15 09:06:19.991667	100	2012-10-15 09:08:12.499445	100	N	CREATE OR REPLACE FUNCTION ad_reorg_process_request_417CE4C90EFB481FB7AA59C2BE4845E9 ()\r\nRETURNS VARCHAR AS\r\n -- SELECT ad_reorg_process_request();\r\n$body$\r\nDECLARE\r\n  v_message VARCHAR;\r\n  v_i INTEGER := 0;\r\n  cur_process_master RECORD;\r\n  cur_process_detail RECORD;\r\n--v_ad_process_request_id ad_process_request.ad_process_request_id%TYPE;\r\nBEGIN\r\n  FOR cur_process_master IN\r\n    (\r\n      SELECT\r\n        req.ad_process_id, count(*) AS process_name_count -- , prc.name\r\n      FROM\r\n        ad_process_request req --, ad_process prc\r\n      WHERE 1=1\r\n       AND req.Channel = 'Process Scheduler'\r\n    -- AND prc.isbackground = 'Y'\r\n    -- AND prc.ad_process_id = req.ad_process_id\r\n      GROUP BY\r\n        req.ad_process_id\r\n      HAVING COUNT(*) > 1\r\n    )\r\n  LOOP\r\n    v_i := 0;\r\n    FOR cur_process_detail IN\r\n    (\r\n     SELECT req2.ad_process_request_id, req2.ad_process_id, req2.channel\r\n     FROM ad_process_request req2\r\n     WHERE req2.ad_process_id = cur_process_master.ad_process_id\r\n      AND req2.channel = 'Process Scheduler'\r\n     ORDER BY\r\n       req2.updated DESC\r\n    )\r\n    LOOP\r\n      v_i := v_i + 1;\r\n      IF (v_i = 1) THEN -- keep 1. of n records, whcih is updated lastestly\r\n        RAISE NOTICE ' keep:   cur_process_detail.ad_process_request_id=''%'' % %', cur_process_detail.ad_process_request_id, cur_process_detail.ad_process_id, cur_process_detail.channel;\r\n      ELSE -- delete 2..n records\r\n        RAISE NOTICE ' delete: cur_process_detail.ad_process_request_id=''%'' % %', cur_process_detail.ad_process_request_id, cur_process_detail.ad_process_id, cur_process_detail.channel;\r\n        DELETE FROM ad_process_request WHERE ad_process_request.ad_process_request_id = cur_process_detail.ad_process_request_id;\r\n      END IF; \r\n    END LOOP;\r\n\r\n  END LOOP;\r\n  v_message := 'SUCCESS';\r\n  RETURN v_message;\r\nEXCEPTION\r\nWHEN OTHERS THEN\r\n  v_message := '@ERROR=' || SQLERRM;\r\n  RAISE EXCEPTION '%', v_message;\r\n  RETURN v_message;\r\nEND;\r\n$body$\r\nLANGUAGE 'plpgsql';	10	2.6.62.063
